import React, { Component } from 'react';
import './App.css';
import NavBar from './components/navBar'
import Counter from './components/counter'

function App() {
  return (
    <React.Fragment className="App">
      <NavBar/>
      <Counter/>
    </React.Fragment>
  );
}

export default App;
